strip_tags = function(text,unstripped){
	var div = $("<div>").html(text);
	div.children().not(unstripped).each(function() {
		var content = $(this).contents();
		$(this).replaceWith(content);
	});
	return div.html();
},


linspace = function(v1,v2,num){
	var array = [];
    var dx = (v2 - v1)/(num-1);
    for (var i = 0; i < num; i++) {
        array.push( v1 + dx*i );
    }
    return array;
},

spaceArray = function(v1,jump,v2){
	var array = [v1];
	var cnt = 0;
    while(array[cnt] + jump <= v2) {
        array.push( array[cnt] + jump );
        cnt ++;
    }
    return array;
}

