/*jslint browser: true*/ /*global  VG*/
VG.NumberFormat = function(fmtStr,units){

	this.formatString = (fmtStr === undefined)? "0.00"  : fmtStr;
	this.units        = (units  === undefined)?  ""     : units;
};

VG.NumberFormat.prototype = {

	constructor: VG.NumberFormat,

	format: function(number){
		if(number instanceof Array){
			return this.arrayFormat(number);
		}
		if(this.formatString.indexOf("E") !== -1){
			return this.exponentialFormat(number);
		}

		var m = this.formatString;
		var v = number;
		var plusSign = false;
		if(m.indexOf("+") !== -1){
			m = m.replace("+","");
			plusSign = true;
		}
		if (!m || isNaN(+v)) {
			return v; //return as it is.
		}
		//convert any string to number according to formation sign.
		v = m.charAt(0) === '-'? -v: +v;
		var isNegative = v<0? v= -v: 0; //process only abs(), and turn on flag.

		//search for separator for grp & decimal, anything not digit, not +/- sign, not #.
		var result = m.match(/[^\d\-\+#]/g);
		var Decimal = (result && result[result.length-1]) || '.'; //treat the right most symbol as decimal
		var Group = (result && result[1] && result[0]) || ',';  //treat the left most symbol as group separator

		//split the decimal for the format string if any.
		m = m.split( Decimal );
		//Fix the decimal first, toFixed will auto fill trailing zero.
		v = v.toFixed( m[1] && m[1].length);
		v = v.toString(); //convert number to string to trim off *all* trailing decimal zero(es)

		//fill back any trailing zero according to format
		var pos_trail_zero = m[1] && m[1].lastIndexOf('0'); //look for last zero in format
		var part = v.split('.');
		//integer will get !part[1]
		if (!part[1] || (part[1] && part[1].length <= pos_trail_zero)) {
			v = (+v).toFixed( pos_trail_zero+1);
		}
		var szSep = m[0].split( Group); //look for separator
		m[0] = szSep.join(''); //join back without separator for counting the pos of any leading 0.

		var pos_lead_zero = m[0] && m[0].indexOf('0');
		if (pos_lead_zero > -1 ) {
			while (part[0].length < (m[0].length - pos_lead_zero)) {
				part[0] = '0' + part[0];
			}
		}
		else if (+part[0] === 0){
			part[0] = '';
		}

		v = v.split('.');
		v[0] = part[0];

		//process the first group separator from decimal (.) only, the rest ignore.
		//get the length of the last slice of split result.
		var pos_separator = ( szSep[1] && szSep[ szSep.length-1].length);
		if (pos_separator) {
			var integer = v[0];
			var str = '';
			var offset = integer.length % pos_separator;
			var i=0, l=integer.length;
			for (; i<l; i++) {
				str += integer.charAt(i); //ie6 only support charAt for sz.
				//-pos_separator so that won't trail separator on full length
				var trailing = (i-offset+1)%pos_separator;
				if (!trailing && i<l-pos_separator ) {
					str += Group;
				}
			}
			v[0] = str;
		}

		v[1] = (m[1] && v[1])? Decimal+v[1] : "";
		return this.addUnits((isNegative?'-':(plusSign?'+':'')) + v[0] + v[1]); //put back any negation and combine integer and fraction.

	},

	arrayFormat: function(number){
		var unitsArray = this.units;
		this.units = "";
		var arrayStr = "";
		var i = 0;
		for(; i< number.length; i++){
			arrayStr += this.format(number[i]) + "-";
		}
		arrayStr = arrayStr.slice(0,-1);
		this.units = unitsArray;
		arrayStr = this.addUnits(arrayStr);
		return arrayStr;
	},

	exponentialFormat: function(number){
	    var fmtStr = this.formatString;
	    var unitsExp = this.units;
	    this.units = "";
	    var e = Math.floor(Math.log(Math.abs(number))/Math.log(10));
	    var f = (e !== 0)? number / Math.pow(10,e) : number;
	    this.formatString = fmtStr.split("E")[0];
	    var part1 = this.format(f);
	    this.formatString = fmtStr.split("E")[1];
	    var part2 = this.format(e);
	    this.formatString = fmtStr;
	    this.units = unitsExp;
	    return this.addUnits(part1 + "E" + part2);
	},

	addUnits: function(str){
		if(this.units instanceof Array){
			return this.units[0] + str + this.units[1];
		}else{
			return str + this.units;
		}
	}


};
VG.NumberFormat.StrikeDip = function(s,d,decimals){
	decimals = (decimals === undefined)? 0 : decimals;
	var sF,dF;
	if(decimals > 0){
		decimalStr = ".";
		while(decimalStr.length <= decimals){decimalStr += "0";}
		sF = new VG.NumberFormat("000"+decimalStr,"º");
		dF = new VG.NumberFormat("00"+decimalStr,"º");
	}else{
		sF = VG.NumberFormat.Strike();
		dF = VG.NumberFormat.Dip();
	}
	return sF.format(s) + " / " + dF.format(d);
};
VG.NumberFormat.Strike = function(){return new VG.NumberFormat("000","º");};
VG.NumberFormat.Rake = function(){return new VG.NumberFormat("+000","º");};
VG.NumberFormat.Dip    = function(){return new VG.NumberFormat("00", "º");};
VG.NumberFormat.Length = function(){return new VG.NumberFormat("0.0", "");};
VG.NumberFormat.Money = function(){return new VG.NumberFormat("#0.00", ["$",""]);};
VG.NumberFormat.USD = function(){return new VG.NumberFormat("#0.00", ["$","USD"]);};
VG.NumberFormat.Scientific = function(){return new VG.NumberFormat("0.00E00", "");};

