var
eye = function(n){
	var mat = new VG.Matrix(null,[n,n]);
	mat.setAll(function(val,el,ij){
		if(ij[0] == ij[1]){
			return 1;
		}else{
			return 0;
		}
	});
	return mat;
},


kron = function(A,B){
	if(!(A.is2D() && B.is2D())){
		throw "Kron: A and B must be 2D arrays"
	}
	if(A instanceof VG.Matrix && B instanceof VG.Matrix){
		//**************** FULL KRON **********************
		var out = new VG.Matrix(null,[ A.sizeDim(1)*B.sizeDim(1),
		                               A.sizeDim(2)*B.sizeDim(2) ]);
		out.setAll(function(val,el,ij){
			var i = ij[0],
			j = ij[1],
			ri = (i % B.sizeDim(1)),
			rj = (j % B.sizeDim(2));
			return A.getIJ([
			                Math.floor((i-1)/A.sizeDim(1))+1,
			                Math.floor((j-1)/A.sizeDim(2))+1])*
			                B.getIJ([
			                         (ri==0)?B.sizeDim(1):ri,
			                         (rj==0)?B.sizeDim(2):rj]);
		});
		return out;
	}else{
		//**************** SPARSE KRON **********************
		var spmat = new VG.Sparse();
		spmat.size = [ A.sizeDim(1)*B.sizeDim(1),
		              A.sizeDim(2)*B.sizeDim(2) ];
		//init storage
		spmat.rind = new Array();
		spmat.cind = new Array();
		spmat.A    = new Array();
		//go over each row
		var cnt = 1;
		spmat.rind.push(1);
		for(var i = 1; i <= spmat.size[0]; i++){
			for(var j = 1; j <= spmat.size[1]; j++){
				var	ri = (i % B.sizeDim(1)),
					rj = (j % B.sizeDim(2)),
					val = A.getIJ([
				                Math.floor((i-1)/A.sizeDim(1))+1,
				                Math.floor((j-1)/A.sizeDim(2))+1])*
				       B.getIJ([
				                (ri==0)?B.sizeDim(1):ri,
				                (rj==0)?B.sizeDim(2):rj]);
				if(val != 0){
					spmat.cind.push(j);
					spmat.A.push(val);
					cnt +=1;
				}
			}
			spmat.rind.push(cnt);
		}
		return spmat;
	}
},

kron3 = function(A,B,C){
	return new kron(A,kron(B,C));
},

triu = function(A){
	if(A instanceof VG.Matrix){
		if(!A.is2D()){throw "triu: must be 2D";}
		var B = new VG.Matrix(null,A.size);
		for(var i = 1;i<=B.sizeDim(1);i++){
			for(var j = i;j<=B.sizeDim(2);j++){
				B.setIJ([i,j],A.getIJ([i,j]));
			}
		}
		return B;
	}else if(A instanceof VG.Sparse){
		if(!A.is2D()){throw "triu: must be 2D";}
		var B = new VG.Sparse().allocate(A.size,A.nnz());
		for(var i = 1;i<=B.sizeDim(1);i++){
			var row = A.getRow(i);
			if(row.length > 0){
				var rowCol = A.getRowCol(i);
				var rowColInd = find(rowCol,function(val){return (val>=i)?true:false;});
				for(var j = 0;j<rowColInd.length;j++){
					B.construct(i,rowCol[rowColInd[j]-1],row[rowColInd[j]-1]);
				}
			}
		}
		B.clean();
		return B;
	}else{
		throw "triu: must be a matrix"
	}
},

tril = function(A){
	if(A instanceof VG.Matrix || A instanceof VG.Sparse){
		if(!A.is2D()){throw "tril: must be 2D";}
		A.transpose();
		var B = triu(A).transpose();
		A.transpose();
		return B;
	}else{
		throw "tril: must be a matrix"
	}
}

