VG.Octree = function ( dims, blkSize ) {
	
	this.blkSize = blkSize;
	this.blocks  = new VG.Matrix(null,dims);
	this.blocks.matrix = new Array(prod(dims));
	
};

VG.Octree.prototype = {

	constructor: VG.Octree,

	create: function( values ){
		//where values is an Array of arrays
		// each inner array has i,j,k,blksize,value
		var Olength = values.length;
		for(var o = 0;o<Olength;o++){
			var i = values[o][0],
				j = values[o][1],
				k = values[o][2],
				blk = values[o][3],
				val = values[o][4];
			this.setIJ(i, j, k, blk, val);
		}
	},
	
	setIJ: function ( i, j, k, blk, val ) {
		if(blk == this.blkSize){
			i = (i-1)/this.blkSize + 1;
			j = (j-1)/this.blkSize + 1;
			k = (k-1)/this.blkSize + 1;
			this.blocks.setIJ([i,j,k],val);
		}else{
			var iB = Math.floor((i-1)/this.blkSize) + 1,
				jB = Math.floor((j-1)/this.blkSize) + 1,
				kB = Math.floor((k-1)/this.blkSize) + 1,
				V  = this.blocks.getIJ([iB,jB,kB]);
			if(typeof(V) == "number" || V == undefined){
				//Split the block
				V = new VG.Octree([2,2,2],this.blkSize/2);
				this.blocks.setIJ([iB,jB,kB],V);
			}
			//renormalize to the top
			i = i - (iB-1)*this.blkSize;
			j = j - (jB-1)*this.blkSize;
			k = k - (kB-1)*this.blkSize;
			V.setIJ(i,j,k,blk,val);
		}
		return this;
	},
	
	getIJ: function(ijk){
		var i=ijk[0],j=ijk[1],k=ijk[2];
		var iB = Math.floor((i-1)/this.blkSize) + 1,
			jB = Math.floor((j-1)/this.blkSize) + 1,
			kB = Math.floor((k-1)/this.blkSize) + 1,
			V  = this.blocks.getIJ([iB,jB,kB]);
		if(V == undefined){
			return null;
		}else if(typeof(V) == "number"){
			return V;
		}else if(V instanceof VG.Octree){
			//renormalize to the top
			i = i - (iB-1)*this.blkSize;
			j = j - (jB-1)*this.blkSize;
			k = k - (kB-1)*this.blkSize;
			return V.getIJ([i,j,k]);
		}
		throw('Octree:getIJ: Not defined.')
	}
}/**
 * @author RowanCockett / http://visiblegeology.com
 */

VG.Sparse = function () {
	
    this.size = [0,0];
    this.A    = [0];//holds the entities
    this.rind = [0];//holds the number of entities in each row
    this.cind = [0];//holds the column index
    
};

VG.Sparse.prototype = {

	constructor: VG.Sparse,

	allocate: function(sz,els){
		this.A = new Array(els);
		this.size = [sz[0],sz[1]];
		this.cind = new Array(els);
        this.rind = setAll(new Array(sz[0]+1),function(){return 1;});
		this._nextEnt = 0;
		return this;
	},
	
	construct: function(i,j,entry){
		this.A[this._nextEnt] = entry;
        this.cind[this._nextEnt] = j;
        this.rind = setAll(this.rind,function(val,ind){
        	if(ind<i){
        		return val;
        	}else{
        		return val + 1;
        	}
        });
        this._nextEnt += 1;
        return this;
	},
	
	clean: function(){
		if(this._nextEnt>=this.A.length){
			return;
		}
		var ind = this._nextEnt-this.A.length;
		this.A = this.A.slice(0,ind);
		this.cind = this.cind.slice(0,ind);
	},
	
	getIJ: function(ij){
		if(ij.length != 2){
			throw "getIJ: length of IJ must equal 2"
		}
		var i = ij[0], j = ij[1];
		if(i > this.size[0] || j > this.size[1]){
			return undefined;
		}
		var row = this.cind.slice(this.rind[i-1]-1,this.rind[i]-1);
		var col = find(row,j);
		if(col.length == 1){
			return this.A[col-1 + this.rind[i-1]-1];
		}else{
			return 0;
		}
	},
	
	getRow: function(r){
		if(r <= this.sizeDim(1) && r > 0){
			return this.A.slice(this.rind[r-1]-1,this.rind[r]-1);
		}else{
			return undefined;
		}
	},

	getRowCol: function(r){
		if(r <= this.sizeDim(1) && r > 0){
			return this.cind.slice(this.rind[r-1]-1,this.rind[r]-1);
		}else{
			return undefined;
		}
	},
	
	sizeDim: function( i ){
		if(i <= this.size.length && i > 0){
			return this.size[i-1];
		}else if(i <= 0){
			throw "sizeDim: dimension must be > 0";
		}else{
			return 0;
		}
	},
	
	is2D: function(){return this.size.length == 2;},
	
	is3D: function(){return this.size.length == 3;},

	numel: function(){
		return this.size[0]*this.size[1];
	},

	nnz: function(){
		return this.A.length;
	},
	
	multiply: function(vector){
		if(vector.sizeDim(1) != this.sizeDim(2)){
			throw "multiply: dimensions must agree"
		}
		var mat = new Array();
		for(var rhs = 1; rhs <= vector.sizeDim(2);rhs ++){
			for(var r = 1;r<= vector.sizeDim(1);r++){
				var row    = this.getRow(r);
				if(row.length > 0){
					var rowCol = this.getRowCol(r);
					var val = 0;
					for(var ii = 0; ii<row.length; ii++){
						val += row[ii]*vector.getIJ([rowCol[ii],rhs]);
					}
					mat.push(val);
				}
			}
		}
        return new VG.Matrix(mat,[this.sizeDim(1),vector.sizeDim(2)]);
	},

	transpose: function(){
		var trip = this.triplet();
		var sz = [this.size[1],this.size[0]];
		var spmat = new VG.Sparse().allocate(sz,this.nnz());
		for(var r = 1;r<=spmat.sizeDim(1);r++){
			var rowColInd = find(this.cind,r);
			for(var el = 0; el < rowColInd.length; el++){
				var col = trip.getIJ([rowColInd[el],1]);
				spmat.construct(r,col,this.A[rowColInd[el]-1]);
			}
		}
		this.A = spmat.A;
		this.rind = spmat.rind;
		this.cind = spmat.cind;
		this.size = spmat.size;
		return this;
	},
	
	triplet: function(){
		var trip = new VG.Matrix(null,[this.A.length,3]);
		var cnt = 1;
		for(var r = 1; r<=this.sizeDim(1);r++){
			var num = this.rind[r] - this.rind[r-1];
			for(var ci = 0;ci<num;ci++){
				trip.setIJ([cnt,1], r);
				trip.setIJ([cnt,2], this.cind[cnt-1]);
				trip.setIJ([cnt,3], this.A[cnt-1]);
				cnt += 1;
			}
		}
		return trip;
	},
	
	full: function(){
		var mat = new Array(this.size[0]*this.size[1]);
		var cnt = 0;
		for(var j = 1; j <= this.size[1]; j++){
			for(var i = 1; i <= this.size[0]; i++){
				mat[cnt] = this.getIJ([i,j]);
				cnt += 1;
			}			
		}
		return new VG.Matrix(mat,this.size);
	},


}/**
 * @author RowanCockett / http://visiblegeology.com
 */

var 

sparse = function(matrix){
	if(!(matrix instanceof VG.Matrix)){
		throw "sparse: input must be a matrix"
	}
	if(!matrix.is2D()){
		throw "sparse: matrix must be 2D"
	}
	var spmat = new VG.Sparse();
	//Copy Size
	spmat.size[0] = matrix.sizeDim(1);
	spmat.size[1] = matrix.sizeDim(2);
	//init storage
	spmat.rind = new Array();
	spmat.cind = new Array();
	spmat.A    = new Array();
	//go over each row
	var cnt = 1;
	spmat.rind.push(cnt);
	for(var r = 1;r<=spmat.sizeDim(1);r++){
		for(var c = 1;c<=spmat.sizeDim(2);c++){
			var val = matrix.getIJ([r,c])
			if(val != 0){
				spmat.cind.push(c);
				spmat.A.push(val);
				cnt +=1;
			}
		}
		spmat.rind.push(cnt);
	}
	return spmat;
},

sdiag = function(vector){
	if(vector instanceof VG.Matrix){
		if(vector.sizeDim(2) != 1){
			throw "sdiag: vector must be an array or a column vector"
		}
		vector = vector.matrix;
	}
	var n = vector.length;
	var spmat = new VG.Sparse();
	spmat.size = [n,n];
	spmat.A    = new Array(n);
	spmat.cind = new Array(n);
	spmat.rind = new Array(n + 1);
	for(var i = 0;i<n;i++){
		//copy the vector into A
		spmat.A[i]    = vector[i];
		//cind increases from 1 to n
		spmat.cind[i] = i + 1;
		//cind increases from 1 to n
		spmat.rind[i] = i + 1;
	}
	spmat.rind[n] = n + 1;
	return spmat;
},

spdiags = function(matrix,diags,size){
	if(size.length != 2){
		throw "spdiags: size must equal 2"
	}
	if(!matrix.is2D()){
		throw "spdiags: matrix must be 2D"
	}
	if(matrix.sizeDim(2) != diags.length){
		throw "spdiags: matrix columns must equal number of diagonals"
	}
	if(!(diags.join() === diags.sort().join())){
		throw "spdiags: diagonals must be sorted."
	}
	var spmat = new VG.Sparse();
	//Copy Size
	var N = size[0],
		M = size[1],
		NgeM = (N>=M)?1:0;
	spmat.size[0] = N;
	spmat.size[1] = M;
	//init storage
	spmat.rind = new Array();
	spmat.cind = new Array();
	spmat.A    = new Array();
	//go over each row
	var cnt = 1;
	spmat.rind.push(cnt);
	for(var r = 1;r<=spmat.sizeDim(1);r++){
		for(var di = 0;di<diags.length;di++){
			var d = diags[di],
				c = r+d;
			if(c<=spmat.sizeDim(2) && c > 0){
				spmat.cind.push(c);
				spmat.A.push(matrix.getIJ([r+NgeM*d,di+1]));
				cnt +=1;
			}
		}
		spmat.rind.push(cnt);
	}
	return spmat;
},

speye = function(n){
	var vector = new Array(n);
	for(var i = 0;i<n;i++){
		vector[i] = 1;
	}
	return sdiag(vector);
},

spy = function(spmat){
	if(!spmat.is2D()){
		throw "toString: Only 2D is implemented."
	}
	var str = "";
	for(var i = 1;i<=spmat.sizeDim(1);i++){
		for(var j = 1;j<=spmat.sizeDim(2);j++){
			var val = spmat.getIJ([i,j]);
			if(val == 0){
				str += " ";
			}else{
				str += "*";
			}
		}
		str += "\n";
	}
	console.log(str);
}



