/** EVENTS
* login
* emailInUseEvent
* passwordResetEvent
* emailNotFoundEvent
* loginFailedEvent
* logoutEvent
*
*/

VG.Login = function ( ) {
	this.info = {sessionID: $.cookie("sid")};
	var self = this;
	$(VG.Bus).bind("loginInfoChangeEvent",function(event,info){
		self.info = info;
		if(info !== null && info.sessionID !== undefined){
			$.cookie("sid",info.sessionID,{ expires: 30 });//days
			$(VG.Bus).trigger("login",[info]);
			$('#loginInfo').html(info.firstName + " " + info.lastName);
		}else{
			$.cookie("sid",null);
			$('#loginInfo').html("");
		}
	});
	$(VG.Bus).bind("loginFailedEvent",function(){
		new VG.Notify("Login Failed","The username/password combination was not recognized.").subTheme("Error");
	});
	this.passiveLogin();
};


VG.Login.prototype = {

	constructor: VG.Login,

	createRegisterBox: function(id){
		var input = new VG.Input(id);
		var self = this;
		input.addTextInput(["First Name",'firstname'],'');
		input.addTextInput(["Last Name",'lastname'],'');
		input.addTextInput(["Organization",'university'],'');
		input.addOptionInput(["I am a",'usertype'],['Student','Teacher','Professional','Avid Enthusiast']);
		var email = input.addTextInput('Email','',emailRegExp,false,"Email in use");
		email.element.change(function(){
			self.checkEmail(email.getValue());
		})
		$(VG.Bus).bind("emailInUseEvent",function(){
			input.setError(4,"Email in use");
		});
		$(VG.Bus).bind("emailNotFoundEvent",function(){
			input.clearError(4);
			input.checkList[4].validate();
		});
		input.addTextInput("Password",'',null,true);
		input.addButton("Create Account",function(answers,go){
			if(go){
				self.register(answers);
			}
		});
		return input;
	},

	createLoginBox: function(id,register){
		if(this.info !== null && this.info.sessionID !== null){
			return this.createLogoutBox(id);
		}
		var input = new VG.Input(id);
		var self = this;
		input.addTextInput("Email",'',emailRegExp);
		input.addTextInput("Password",'',null,true);
		input.addButton("Login",function(answers,go){
			if(go){
				self.login(answers.email,answers.password);
				VG.Notify.closeAll();
			}
		});
		if(register){
			input.addText("Don't have an account?");
			input.addButton("Sign Up",function(answers,go){
				VG.Notify.closeAll();
				new VG.Notify("Sign Up","",self.createRegisterBox().panel).subTheme("Warn");
			});
		}
		return input;
	},


	createLogoutBox: function(id){
		var input = new VG.Input(id);
		input.addText("You are currently logged in.");
		var self = this;
		input.addButton("Logout",function(){
			self.logout();
			VG.Notify.closeAll();
		});
		return input;
	},


	register: function(answers){
		$.getJSON('loginService', {
			requestType: "register",
			firstName:answers.firstname,
			lastName:answers.lastname,
			emailAddress:answers.email,
			password:answers.password,
			university:answers.university,
			userDescription:answers.usertype,
		},function(data) {
			if(data === null){
				$(VG.Bus).trigger("emailInUseEvent");
			}else{
				VG.Notify.closeAll();
				$(VG.Bus).trigger("loginInfoChangeEvent",[data]);
			}
		});
	},

	checkEmail: function(email){
		$.getJSON('loginService', {
			requestType: "checkEmail",
			emailAddress:email,
		},function(data) {
			if(data !== null){
				$(VG.Bus).trigger("emailInUseEvent");
			}else{
				$(VG.Bus).trigger("emailNotFoundEvent");
			}
		});
	},


	resetPassword: function(email){
		$.getJSON('loginService', {
			requestType: "checkEmail",
			emailAddress:email,
		},function(data) {
			if(data === null){
				$(VG.Bus).trigger("emailNotFoundEvent");
			}else{
				$(VG.Bus).trigger("passwordResetEvent");
			}
		});
	},


	login: function(email,password){
		$.getJSON('loginService', {
			requestType: "validate",
			emailAddress: email,
			password: password
		},function(data) {
			$(VG.Bus).trigger("loginInfoChangeEvent",[data]);
			if(data === null){
				$(VG.Bus).trigger("loginFailedEvent");
			}
		});
	},

	passiveLogin: function(){
		this.info = {sessionID: $.cookie("sid")};
		if(this.info.sessionID === null){return;}

		$.getJSON('loginService', {
			requestType: "validate",
			sessionID:this.info.sessionID
		},function(data) {
			$(VG.Bus).trigger("loginInfoChangeEvent",[data]);
		});
	},


	logout: function(){
		if(this.info.sessionID === null && $.cookie("sid") === null){
			return;//already logged out (no information here at least)
		}
		$.getJSON('loginService', {
			requestType: "logout",
			sessionID:this.info.sessionID
		},function(data) {
			$(VG.Bus).trigger("logoutEvent",[data]);
		});
	},


	isLoggedIn: function(){
		return !(
			this.info === null ||
			this.info.sessionID === undefined ||
			this.info.sessionID === null ||
			this.info.sessionID.length === 0
			);
	},





};
/*jslint browser: true*/ /*global  $*/
var Contact = function ( subject ) {
    var self = this;

    var emailSubject = (subject === undefined)? "" : subject;


    var emailDiv = $('<div id="emailDiv">');

    var emailForm = $('<div id="emailForm">');
    var emailError = $('<div id="emailError">');
    emailForm.append(emailError);
    var emailMessage = $('<textarea placeholder="Message goes here!" id="emailMessage" tabindex="3" class="emailFormInput">');
    emailForm.append(emailMessage);
    var emailName = $('<input type="text" placeholder="Name" id="emailName" tabindex="1" class="emailFormInput">');
    emailForm.append(emailName);
    emailForm.append($('<br>'));
    var emailAddress = $('<input type="email" placeholder="Email" id="emailAddress" tabindex="2" class="emailFormInput">');
    emailForm.append(emailAddress);
    emailForm.append($('<br>'));
    sendEmailButton = $('<input id="sendEmailButton" type="submit" value="Send" class="emailFormInput">');
    emailForm.append(sendEmailButton);

    var emailSent = $('<div id="emailSent">');
    emailSent.append($('<span>').html('Sending mail...'));
    emailSent.append($('<span>').html('There was an error sending the email. Please refresh and try again later.'));
    emailSent.append($('<span>').html('Thank you for contacting me, I will try to get back to you soon.'));

    emailDiv.append(emailForm).append(emailSent);

    this.closeLink = $('<div id="emailCloseFeedback" class="emailButton">').html("Close").hide();
    this.div = emailDiv;
    this.button = sendEmailButton;
    this.emailError = emailError;

    this.modal = $('<div class="contact_modal" style="position: fixed; width: 100%; height: 100%; background-color: rgb(0, 0, 0); z-index: 1000; opacity: 0.3; left: 0px; top: 0px;">');




    var ids = [emailName,emailAddress,emailMessage];


    function changeError(num,showError,tag){
        if(num === -1){for(var ii=0;ii<ids.length;ii++){changeError(ii,showError,tag);}return;}
        if(showError){
            ids[num].addClass('emailError');
        }else{
            ids[num].removeClass('emailError');
        }
        if(tag !== undefined && showError){
            emailError.html(tag);
        }else{
            emailError.html('');
        }
    }
    this.changeError = changeError;

    function clearForm(){
        changeError(-1,false);
        ids[2].val("");
    }


    function validateEmail(emailStr) {
        var re = /^(([^<>()[\]\\.,;:\s@\"]+(\.[^<>()[\]\\.,;:\s@\"]+)*)|(\".+\"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
        var valid = re.test(emailStr);
        changeError(1,!valid && emailStr.length > 0,"Please enter a valid email.");
        return valid;
    }

    ids[0].keypress(function(){changeError(0,false);});
    ids[1].blur(function(){validateEmail($(this).val());});
    ids[2].keypress(function(){changeError(2,false);});
    sendEmailButton.click(function(){
        if(self.isFeedback && self.isClosed){
            sendEmailButton.val('Send');
            emailDiv.animate({left:0},500,'swing');
            self.isClosed = false;
            self.closeLink.show();
            $('body').prepend(self.modal.show()).fadeIn();
            self.modal.click(function(){self.closeFeedback();});
            return;
        }
        changeError(0,ids[0].val().length === 0);
        changeError(2,ids[2].val().length === 0);
        var valid = validateEmail(ids[1].val());
        changeError(1,!valid || ids[1].val().length === 0,"Please enter a valid email.");

        if(!valid || ids[0].val().length === 0 || ids[2].val().length === 0){
            if(emailError.html().length === 0){
                var addName = ids[0].val().length === 0? 'name' : '';
                var addMesg = ids[2].val().length === 0? 'message' : '';
                var addBoth = (ids[0].val().length === 0 && ids[2].val().length === 0)? ' and ' : '';
                emailError.html('Please enter your ' + addName + addBoth + addMesg + '.');
            }
            return;
        }

        var messages = emailSent.children().hide();
        messages.first().show();
        emailDiv.children().css({position:'relative'}).animate({top:-150},500,'swing');


        // SEND THE EMAIL.
        function showResponse(email){
            messages.hide();
            if(email.sent){
                $(messages[2]).show();
            }else{
                $(messages[1]).show();
            }
            if(self.isFeedback && email.sent){
                clearForm();
                setTimeout(function(){
                    emailDiv.children().css({position:'relative'}).animate({top:0},500,'swing',function(){
                        self.closeFeedback();
                    });
                },1500);
            }
        };

        var sendData = {name:ids[0].val(),email:ids[1].val(),comments:ids[2].val(),subject:emailSubject};
        function successHandler(data){
            var email = {sent:false};
            try{
                email = JSON.parse(data);
            }catch(e){}
            showResponse(email);
        };
        try{
            $.post("http://visiblegeology.com/email.php",sendData,successHandler);
        }catch(e){
            showResponse({sent:false});
        }

    });
};


Contact.prototype = {

    constructor: Contact,

    makeFeedback: function(){
        var self = this;
        this.isFeedback = true;
        this.isClosed = true;
        this.div.css({position:'absolute','z-index':1001,bottom:40,left:-661});
        this.button.val('Feedback');

        self.closeLink.click(function(){
            self.closeFeedback();
        })
        this.div.children().first().append(this.closeLink);
        $('body').append(this.div);
    },

    closeFeedback: function(){
        this.changeError(-1,false);
        this.isClosed = true;
        this.emailError.html("");
        this.button.val('Feedback');
        this.div.animate({left:-661},500,'swing');
        this.modal.fadeOut(500,function(){$(this).remove();});
        this.closeLink.hide();
    },

};

