/*jslint browser: true*/ /*global  VG*/
VG.FaultObject = function (strike,dip,rake,slip,point,length,center) {
	this.type = "fault";
	this.niceName = "Faulting Event";
	this.numberDefaults = 6;
	this.defaultNames = ["Normal Fault","Reverse Fault","Thrust Fault","Left-lateral Strike-slip Fault","Right-lateral Strike-slip Fault","Random Fault"];
	this.set(strike,dip,rake,slip,point,length,center);
};


VG.FaultObject.prototype = {

	constructor: VG.FaultObject,

	set: function(strike,dip,rake,slip,point,length,center){
		this.strike = (strike === undefined)? 0 : strike;
		this.dip    = (dip === undefined)? 90 : dip;
		this.rake   = (rake === undefined)? 90 : rake;
		this.slip   = (slip === undefined)? 10 : slip;
		this.point  = (point === undefined)? new VG.Vector(0,0,0) : point;
		this.center  = (center === undefined)? new VG.Vector(0,0,0) : center;
		this.length  = (length === undefined)? 0 : length;
		this.update();
	},


	colorXYZ: function(pt){
		var dist = this.plane.getDistance(pt);
		if(Math.abs(dist) <= 0.5){
			return [0,0,0.75];
		}else{
			return null;
		}
	},

	// getTranlation: function(pt){
	// 	var dist = this.plane.getDistance(pt);
	// 	var pos = (dist >= 0)? true : false;
	// 	if(pos){
	// 		return this.direction.clone().setLength(this.slip);
	// 	}else{
	// 		return new VG.Vector();
	// 	}
	// },

	// fragmentShader: function(){
	// 	var fmt = new VG.NumberFormat("0.0");
	// 	var planeString = "vec4(" + fmt.format(this.plane.A) + "," +  fmt.format(this.plane.B) + "," +  fmt.format(this.plane.C) + ",0.0)";
	// 	var shader = [
	// 			"	if(!done){",
	// 			"		if(abs(dot(" + planeString +"," + getRotatedVPosition() + ")-(" + fmt.format(this.plane.D) + "))<=0.2){",
	// 			"			gl_FragColor = vec4(0.0,0.0,0.8,1.0);",
	// 			"			done = true;",
	// 			"		}else if(dot(" + this.planeString +"," + getRotatedVPosition() + ")-(" + fmt.format(this.plane.D) + ")>=0.0){",
	// 			"			tPos = tPos + (vec4(" + this.direction.getFloatString() + ") * " + fmt.format(this.slip) + ");",
	// 			"		}",
	// 					invRotTPos(),
	// 			"	}",
	// 	];
	// 	return shader.join("\n");
	// },

	update: function() {
		this.plane = new VG.Plane();
		this.plane.fromStrikeAndDip(this.strike, this.dip, this.point);
		this.direction = getRakeVector(this.strike, this.dip, this.rake).negate();
	},

	moment: function(depth,rigidity){
		rigidity = (rigidity === undefined)? 3E10 : rigidity;
		var width = (depth[1] - depth[0]) / Math.sin(toRadians(this.dip));
		return rigidity * this.length * width * this.slip;
	},

	magnitude: function(depth,rigidity){
		return (2/3) * log10(this.moment(depth,rigidity)) - 6.03;
	},

	name: function(){
		if(this.slip === 0){
			return "";
		}
		var r = -this.rake + ((this.rake>0)?360:0);
		if(Math.abs(r - 90) <= 30){
			return "Normal Fault";
		}else if(Math.abs(r - 270) <= 30){
			if(this.dip <= 30){
				return "Thrust Fault";
			}
			return "Reverse Fault";
		}else if(Math.abs(r - 180) <= 30){
			return "Right-lateral Strike-Slip Fault";
		}else if(r <= 15 || r >= 345){
			return "Left-lateral Strike-Slip Fault";
		}
		var dir,type,name;
		if(r >= 270 || r <= 90){
			dir = "Left-lateral ";
		}else{
			dir = "Right-lateral ";
		}
		if(r <= 180){
			type = "Normal ";
		}else{
			type = "Reverse ";
		}
		name = dir + type + "Oblique Fault";
		return name;
	}

};

VG.FaultObject.getDefault = function(num){
	switch(num){
		case 0:return VG.FaultObject.normalFault();
		case 1:return VG.FaultObject.reverseFault();
		case 2:return VG.FaultObject.thrustFault();
		case 3:return VG.FaultObject.leftLateralFault();
		case 4:return VG.FaultObject.rightLateralFault();
		case 5:return VG.FaultObject.random();
		default: return null;
	}
};

VG.FaultObject.normalFault = function(){return new VG.FaultObject(nextInt(360),nextInt(90),90,nextInt(30)+20,new VG.Vector());};
VG.FaultObject.reverseFault = function(){return new VG.FaultObject(nextInt(360),nextInt(60)+30,270,nextInt(30)+20,new VG.Vector());};
VG.FaultObject.thrustFault = function(){return new VG.FaultObject(nextInt(360),nextInt(10)+20,270,nextInt(30)+20,new VG.Vector());};
VG.FaultObject.leftLateralFault = function(){return new VG.FaultObject(nextInt(360),nextInt(90),0,nextInt(30)+20,new VG.Vector());};
VG.FaultObject.rightLateralFault = function(){return new VG.FaultObject(nextInt(360),nextInt(90),180,nextInt(30)+20,new VG.Vector());};
VG.FaultObject.random = function(){return new VG.FaultObject(nextInt(360),nextInt(90),nextInt(360),nextInt(30)+20,new VG.Vector());};VG.ModelHistoryData = function ( JSON ) {
    if(JSON !== undefined){
        this.parseJSON(JSON);
    }
};


VG.ModelHistoryData.prototype = {

    constructor: VG.ModelHistoryData,

    parseJSON: function(json){
        this.ID = json.ID;
        this.author = json.author;
        this.keyword = json.keyword;
        this.name = json.name;
        var h = [];
        for (var i = 0; i < json.history.length; i++) {
            var type = json.history[i].type.toLowerCase();
            if(type === "beds"){h.push(new VG.BedsObject(json.history[i]));}
        }
        this.history = h;
    },

    getColor: function(xyz){
        return this.getPointInfo(xyz,true);
    },

    getPointInfo: function(xyz,justColor){
        justColor = (justColor === undefined)? true : justColor;
        var color = [0,0,0];
        var translation = new VG.Vector();
        var rot = new VG.Matrix4();
        var invRot = new VG.Matrix4();
        var type = "";
        var go = true;
        var i = this.history.length-1;
        while(go && i>=0){
            type = this.history[i].type.toLowerCase();
            if(type === "beds"){
                var myBeds = this.history[i];
                color = myBeds.colorXYZ(rot.multiplyVector(translation.clone().addSelf(xyz)));
                go = false;
            }else if(type === "fold"){
                var myFolds = this.history[i];
                translation.addSelf(myFolds.getTranlation(rot.multiplyVector(translation.clone().addSelf(xyz))));
                translation = invRot.multiplyVector(translation);
            }else if(type === "dome"){
                var myDome = this.history[i];
                translation.addSelf(myDome.getTranlation(rot.multiplyVector(translation.clone().addSelf(xyz))));
                translation = invRot.multiplyVector(translation);
            }else if(type === "tilt"){
                var myTilt = this.history[i];
                rot.multiplySelf(myTilt.getRotation());
                invRot.multiplySelf(myTilt.getInvRotation());
            }else if(type === "dyke"){
                var myDyke = this.history[i];
                var tempcolor = myDyke.colorXYZ(rot.multiplyVector(translation.clone().addSelf(xyz)));
                if(tempcolor !== null){
                    color[0] = tempcolor[0];
                    color[1] = tempcolor[1];
                    color[2] = tempcolor[2];
                    go = false;
                    if(!justColor){
                        var tilt = new VG.TiltObject(myDyke.strike,myDyke.dip);
                        invRot.multiplySelf(tilt.getInvRotation());
                    }
                }
            }else if(type === "simpleunconformity"){
                var myUncon = this.history[i];
                var tempcolor = myUncon.colorXYZ(rot.multiplyVector(translation.clone().addSelf(xyz)));
                if(tempcolor !== null){
                    color[0] = tempcolor[0];
                    color[1] = tempcolor[1];
                    color[2] = tempcolor[2];
                    go = false;
                }
            }else if(type === "fault"){
                var myFault = this.history[i];
                var tempcolor = myFault.colorXYZ(rot.multiplyVector(translation.clone().addSelf(xyz)));
                if(tempcolor !== null){  //colors the fault line
                    color[0] = tempcolor[0];
                    color[1] = tempcolor[1];
                    color[2] = tempcolor[2];
                    go = false;
                    if(!justColor){
                        var tilt = new VG.TiltObject(myFault.strike,myFault.dip);
                        invRot.multiplySelf(tilt.getInvRotation());
                    }
                }else{
                    translation.addSelf(myFault.getTranlation(rot.multiplyVector(translation.clone().addSelf(xyz))));
                    translation = invRot.multiplyVector(translation);
                }
            }else if(type === "blindthrust"){
                var myBlindThrust = this.history[i];
                var tempcolor = myBlindThrust.colorXYZ(rot.multiplyVector(translation.clone().addSelf(xyz)));
                if(tempcolor !== null){//colors the fault line
                    color[0] = tempcolor[0];
                    color[1] = tempcolor[1];
                    color[2] = tempcolor[2];
                    go = false;
                    if(!justColor){
                        var tilt = new TiltObject(myBlindThrust.strike,myBlindThrust.dip);
                        invRot.multiplySelf(tilt.getInvRotation());
                    }
                }else{
                    translation.addSelf(myBlindThrust.getTranlation(rot.multiplyVector(translation.clone().addSelf(xyz))));
                    translation = invRot.multiplyVector(translation);
                }
            }else if(type === "faultbend"){
                var myFaultBend = this.history[i];
                var tempcolor = myFaultBend.colorXYZ(rot.multiplyVector(translation.clone().addSelf(xyz)));
                if(tempcolor !== null){//colors the fault line
                    color[0] = tempcolor[0];
                    color[1] = tempcolor[1];
                    color[2] = tempcolor[2];
                    go = false;
                    if(!justColor){
                        var tilt = new TiltObject(myFaultBend.strike,myFaultBend.dip);
                        invRot.multiplySelf(tilt.getInvRotation());
                    }
                }else{
                    translation.addSelf(myFaultBend.getTranlation(rot.multiplyVector(translation.clone().addSelf(xyz))));
                    translation = invRot.multiplyVector(translation);
                }
            }
            i--;
        }
        if(justColor){
            return color;
        }else{
            var t = new VG.Vector(translation);
            t.negate();
            var v = invRot.multiplyVector(t.clone().addSelf(xyz));
            return [v.x,v.y,v.z,i+1];
        }
    }
};/**
 * @author RowanCockett / http://visiblegeology.com
 */


VG.Orient = function(faultObj,id,w,h,moving,change){
	this.id = id;
	this.r = Raphael(id,w,h);
	this.fault = (faultObj !== undefined)? faultObj : new VG.FaultObject(0,50,270,0,new VG.Vector(),100,new VG.Vector());

	//translate is called to translate between pixel values and map values
	this.translate = function(type,center,length){
		if(type === 'pixels'){
			return {
				center: center.clone(),
				length: length
			};
		}else if(type === 'units'){
			return {
				center: center.clone(),
				length: length
			};
		}
	};

	this.isMoving = false;

	this.createControls();
	this.dipToRight = true;
	this.recalculate();
	this.moving = moving;
	this.change = (change !== undefined)? change : moving;
	var self = this;
	this.changeTimer = new VG.Timer(function(){
		self.change();
	});
};

VG.Orient.prototype = {

	constructor: VG.Orient,

	createControls: function(){
		var self = this;
		this.path = [["M", 0, 0], ["L", 0, 0]];
		this.dipPath = [["M", 0, 0], ["L", 0, 0]];
		// path2 = [["M", x, y], ["L", ax, ay], ["M", bx, by], ["L", zx, zy]],
		this.faultLine = this.r.path(this.path).attr({stroke: "#333", "stroke-width": 4, "stroke-linecap": "round"});
		var dashedAttr = {
			fill: "#000",
			"fill-opacity":0,
			stroke: "#000",
			"stroke-dasharray": ". ",
			"stroke-width": 2
		};
		this.dipLine = this.r.path(this.dipPath).attr(dashedAttr);
		var controls = this.r.set(
			//middle
			this.newDisk(0, 0, dashedAttr, {"fill-opacity":0.1}, "move"),
			//top
			this.newDisk(0, 0),
			//bottom
			this.newDisk(0, 0),
			//dip
			this.newDisk(0, 0),
			//rake
			this.newDisk(0, 0)
		);
		//middle
		controls[0].update = function (x, y) {
			var X = this.attr("cx") + x;
			var Y = this.attr("cy") + y;
			this.attr({cx: X, cy: Y});
			//updates all other points.
			controls[1].update(x, y, false);
			controls[2].update(x, y, false);
			controls[3].recalculate();
		};
		controls[0].recalculate = function(){
			var m = self.midpoint();
			this.attr({cx: m.x, cy: m.y, r: self.radius() + 14});
			controls[3].recalculate();
			self.calculateParams();
		};
		controls[1].update = function (x, y, recalc) {
			var X = this.attr("cx") + x,
				Y = this.attr("cy") + y;
			this.attr({cx: X, cy: Y});
			self.path[0][1] = X;
			self.path[0][2] = Y;
			self.faultLine.attr({path: self.path});
			if(recalc){controls[0].recalculate()};
		};
		controls[2].update = function (x, y, recalc) {
			var X = this.attr("cx") + x,
				Y = this.attr("cy") + y;
			this.attr({cx: X, cy: Y});
			self.path[1][1] = X;
			self.path[1][2] = Y;
			self.faultLine.attr({path: self.path});
			if(recalc){controls[0].recalculate()};
		};
		// dip
		controls[3].update = function (x, y) {
			var line = self.line().normalize();
			var dot = new VG.Vector(x,y,0).dot(line);
			var pos = new VG.Vector(this.attr("cx") + x - dot*line.x, this.attr("cy") + y - dot*line.y,0);
			var dipVec = self.midpoint().subSelf(pos);//mid to dip
			var crs = new VG.Vector().cross(new VG.Vector(0,0,1),line);
			var sign = -1;
			if(crs.dot(dipVec) > 0){
				sign = 1;
			}
			self.dipToRight = (sign === 1);
			self.dip = Math.min(Math.max(-90,sign*dipVec.length()),90);
			this.recalculate();
		};
		controls[3].recalculate = function(){
			var cross = self.line().crossSelf(new VG.Vector(0,0,1)).normalize();
			var mid = self.midpoint();
			var point = new VG.Vector().copy(cross).multiplyScalar(self.dip).addSelf(mid);
			this.attr({cx: point.x, cy: point.y});
			self.dipPath[0][1] = mid.x-90*cross.x;
			self.dipPath[0][2] = mid.y-90*cross.y;
			self.dipPath[1][1] = mid.x+90*cross.x;
			self.dipPath[1][2] = mid.y+90*cross.y;
			self.dipLine.attr({path: self.dipPath});
			controls[4].recalculate();
			self.calculateParams();
		};

		//rake
		controls[4].update = function (x, y) {
			var X = this.attr("cx") + x,
				Y = this.attr("cy") + y;
			var north = new VG.Vector().sub(self.endpoint(self.strikeEndpoint()),self.midpoint()).normalize();
			var dir   = new VG.Vector( X, Y, 0 ).subSelf(self.midpoint()).normalize();
			self.fault.rake = 360 - getBearing(dir,north);
			if(self.fault.rake > 180){
				self.fault.rake = self.fault.rake - 360;
			}
			self.fault.rake = -self.fault.rake;
			this.dx = this.dy = 0;
			this.recalculate();
		};
		controls[4].recalculate = function(){
			var point = self.endpoint(self.strikeEndpoint()).subSelf(self.midpoint()).normalize();
			var M = new VG.Matrix4().rotateZ(-toRadians(self.fault.rake));
			point = M.multiplyVector(point);
			point.setLength(self.radius() + 14).addSelf(self.midpoint());
			this.attr({cx: point.x, cy: point.y});
		};

		function start() {
			this.dx = this.dy = 0;
			self.update();
		}
		function move(dx, dy) {
			self.isMoving = true;
			this.update(dx - (this.dx || 0), dy - (this.dy || 0), true);
			this.dx = dx;
			this.dy = dy;
			self.update();
		}
		function end() {
			self.isMoving = false;
		}

		controls.drag(move, start, end);
		this.controls = controls;
	},

	newDisk: function (x,y,attr,attrOver,cursor){
		var self = this;
		attr = (attr === undefined)? {r:7,fill: "#aaa", stroke: "#000", "stroke-width":1} : attr;
		attrOver = (attrOver === undefined)? {r:15,fill: "#0000ff", stroke: "#fff", "stroke-width":2.5} : attrOver;
		return this.r.circle(x,y, 7).attr(attr).mouseover(function(){
			$("#"+self.id).css({cursor:(cursor === undefined)?"pointer":cursor});
			this.animate(attrOver,200);
		}).mouseout(function(){
			$("#"+self.id).css({cursor:"auto"});
			this.animate(attr,200);
		});
	},

	endpoint: function(num){
		if(num == 0){
			return new VG.Vector( this.path[0][1] , this.path[0][2] , 0);//end 1
		}else if(num == 1){
			return new VG.Vector( this.path[1][1] , this.path[1][2] , 0);//end 2
		}
	},

	strikeEndpoint: function(){
		return (this.dipToRight)? 1 : 0;
	},

	line: function(){
		return new VG.Vector().sub(this.endpoint(0),this.endpoint(1));
	},

	midpoint: function(){
		return new VG.Vector().add(this.endpoint(0),this.endpoint(1)).multiplyScalar(0.5);//midpoint
	},

	radius: function(){
		return this.line().length()/2;
	},

	recalculate: function(){
		if(this.isMoving){return;}

		var spatial = this.translate("pixels",this.fault.center,this.fault.length);
		// console.log("recalc " + this.id + "  length:" + spatial.length + "  x:" + spatial.center.x + "  y:" + spatial.center.y);

		this.dip = 90-this.fault.dip;
		this.dipToRight = true;
		var r = 360 - this.fault.strike;
		var M = new VG.Matrix4().rotateZ(-toRadians(r));
		var point = M.multiplyVector(new VG.Vector(0,1,0)).setLength( spatial.length / 2 );
		var point0 = this.endpoint(0).subSelf(spatial.center).subSelf(point);
		var point1 = this.endpoint(1).subSelf(spatial.center).subSelf(point.negate());
		this.controls[1].update(-point0.x,-point0.y, false);
		this.controls[2].update(-point1.x,-point1.y, false);
		this.controls[0].recalculate();
	},

	calculateParams: function(){
		if(!this.isMoving){return;}
		this.fault.strike = firstWv(((this.dipToRight)?360:180)-getBearing( this.line().negate() , new VG.Vector(0,-1,0)),360);

		var spatial = this.translate("units",this.midpoint(),this.line().length());
		// console.log("param" + this.id + "   " + spatial.length);

		this.fault.length = spatial.length;
		this.fault.center.x = spatial.center.x;
		this.fault.center.y = spatial.center.y;

	},

	update: function(){
		this.fault.dip = 90 - Math.abs(this.dip);
		this.changeTimer.cancel().schedule(500);
		this.moving();
	},

	resize: function(w,h){
		w = (w === undefined)? $(window).width() : w;
		h = (h === undefined)? $(window).height() : h;
		this.r.setSize(w,h);
	},

	showReduced: function(bool){
		if(bool){
			// this.faultLine.hide();
			this.dipLine.hide();
			// this.controls[1].hide();
			// this.controls[2].hide();
			this.controls[3].hide();
			this.controls[4].hide();
		}else{
			// this.faultLine.show();
			this.dipLine.show();
			// this.controls[1].show();
			// this.controls[2].show();
			this.controls[3].show();
			this.controls[4].show();
		}
	},

	setVisible: function(bool){
		$(this.r.canvas).css({display:(bool)?'':'none'})
	},

};



