VG.ThreePanel.prototype = {

	constructor: VG.ThreePanel,

	setSize: function( w, h ){
		this.width  = (w !== undefined)? w : $(window).width();
		this.height = (h !== undefined)? h : $(window).height();
		this.renderer.setSize(this.width, this.height);
		$(this.panel).width(this.width).height(this.height);
		$(this.renderer.domElement).width(this.width).height(this.height);
		this.cameraControler.aspectRatio = this.width/this.height;
		if(this.doAnimate){
			if(this.camera instanceof THREE.OrthographicCamera){
				this.camera.left = -this.cameraControler.getWidth()/2;
				this.camera.right = +this.cameraControler.getWidth()/2;
				this.camera.bottom = -this.cameraControler.getHeight()/2;
				this.camera.top = +this.cameraControler.getHeight()/2;
			}else{
				this.camera.setSize(this.width, this.height);
			}
			this.camera.updateProjectionMatrix();
			this.cameraControler.fakeChanged();
		}
	},

	start: function(){
		this.doAnimate = true;
		this.cameraControler.fakeChanged();
		this.renderer.render(this.scene, this.camera);
		var self = this;
		this.timer = setInterval(function(){self.animate();},1000/60);
	},

	stop: function(){
		this.doAnimate = false;
		clearInterval(this.timer);
	},

	animate: function(){
		if(!this.doAnimate){return;}

		if(this.camera instanceof THREE.OrthographicCamera){
			this.camera.left = -this.cameraControler.getWidth()/2;
			this.camera.right = +this.cameraControler.getWidth()/2;
			this.camera.bottom = -this.cameraControler.getHeight()/2;
			this.camera.top = +this.cameraControler.getHeight()/2;
		}else{
			this.camera.setSize(this.width, this.height);
		}
		var pu = this.cameraControler.getPositionAndUpDirection();
		this.camera.position.copy(pu[0]);
		this.camera.lookAt(this.cameraControler.getCameraTarget());
		this.camera.up.copy(pu[1]);
		this.camera.updateProjectionMatrix();
		for(var i = 0;i < this.preRenderHandlers.length;i++){
			this.preRenderHandlers[i](this.cameraControler);
		}
		for(var i = 0;i < this.threeDivs.length; i++){
			this.threeDivs[i].updatePosition();
		}
		if(this.cameraControler.renderNow()){
			this.render();
		}
	},


	animateObject: function(object,to,num){
		num = (num === undefined)?200:num;
		var cnt = 0,timer,CC = this.cameraControler;
		var dx = (to.x-object.position.x)/num;
		var dy = (to.y-object.position.y)/num;
		var dz = (to.z-object.position.z)/num;
		function incPos(){
			if(cnt>num){
				clearInterval(timer);
				CC.renderContinuous = false;
				return;
			}
			CC.renderContinuous = true;
			object.position.set(object.position.x+dx,object.position.y+dy,object.position.z+dz);
			cnt +=1;
		}
		timer = setInterval(function(){incPos();},1000/60);
		return timer;
	},


	changeCamera: function(camera){
		this.scene.remove(this.camera);
		this.camera = camera;
		this.scene.add(this.camera);
	},

	preEvent: function(event){
		event.preventDefault();
		event.stopPropagation();
		$(this.panel).focus();
	},

	mousedown: function(event){
		this.preEvent(event);
		this.mouseDown=true;
		this.mouseDownX=event.pageX;
		this.mouseDownY=event.pageY;
		for(var i = 0;i < this.startHandlers.length;i++){
			this.startHandlers[i](event);
		}
	},

	mouseup: function(event) {
		this.preEvent(event);
		this.mouseDown=false;
		for(var i = 0;i < this.endHandlers.length;i++){
			this.endHandlers[i](event);
		}
	},

	mousemove: function(event) {
		this.preEvent(event);
		this.intersects = null;
		var x = event.pageX,
			y = event.pageY;
		var diffX=x-this.mouseDownX,
			diffY=y-this.mouseDownY;
		this.mouseDownX=x;
		this.mouseDownY=y;
		if(this.mouseDown){
			if(this.moveHandlers.length > 0){
				var rot = this.cameraControler.getReverseRotationMatrix();
				var vec = rot.multiplyVector3(new THREE.Vector3(diffX, -diffY, 0));
				for(var i = 0;i < this.moveHandlers.length;i++){
					var go = this.moveHandlers[i](vec,event);
					if(!go){
						$(this.panel).css({cursor:'crosshair'});
						this.cameraControler.fakeChanged();
						return;
					}else{
						$(this.panel).css({cursor:''});
					}
				}
			}
			this.cameraControler.incrementRotationX(diffY);
			this.cameraControler.incrementRotationZ(diffX);
		}else{
			var allGO = true;
			for(var i = 0;i < this.hoverHandlers.length;i++){
				var go = this.hoverHandlers[i](event);
				if(!go){allGO = false;}
			}
			if(!allGO){
				$(this.panel).css({cursor:'crosshair'});
			}else{
				$(this.panel).css({cursor:''});
			}
		}
	},

	keydown: function(event) {
		for(var i = 0; i < this.keyHandlers.length; i++){
			var go = this.keyHandlers[i](event);
			if(!go){this.cameraControler.fakeChanged();return;}
		}
		if(this.defaultKeys){
			var CC = this.cameraControler;
			switch(event.keyCode){
				case 82://r
					CC.turnViewTo2D();break;
				case 51://3
					CC.turnViewTo3D();break;
				case 37://LEFT
					CC.turnViewTo(NaN,NaN,CC.rotationZ-20);break;
				case 38://UP
					CC.turnViewTo(CC.rotationX-20,NaN,NaN);break;
				case 39://RIGHT
					CC.turnViewTo(NaN,NaN,CC.rotationZ+20);break;
				case 40://DOWN
					CC.turnViewTo(CC.rotationX+20,NaN,NaN);break;
				case 27://ESC
					for(var i = 0; i < this.escHandlers.length; i++){
						var go = this.escHandlers[i](event);
						if(!go){return;}
					}
			}
		}
	},

	scroll: function(event){
		if(!this.zoomEnabled && this.scrollHandlers.length ===0){
			return;
		}
		this.preEvent(event);
		var z = -event.wheelDeltaY;
		for(var i = 0; i < this.scrollHandlers.length; i++){
			var go = this.scrollHandlers[i](z);
			if(!go){this.cameraControler.fakeChanged();return;}
		}
		if(this.zoomEnabled){
			this.cameraControler.doZoom(z);
		}
	},

	setFocus: function(boolean){
		if(boolean){
			this.panel.focus();
		}else{
			this.panel.blur();
		}
	},

	addObject: function(object,render){
		this.scene.add(object);
		if(render){
			this.cameraControler.fakeChanged();
		}
	},

	removeObject: function(object,render){
		this.scene.remove(object);
		if(render){
			this.cameraControler.fakeChanged();
		}
	},

	render: function(){
		this.renderer.render(this.scene, this.camera);
	},

	registerThreeDiv: function(threeDiv){
		this.threeDivs.push(threeDiv);
		this.panel.append(threeDiv.div);
	},

	getFirstPointIntersects: function() {
		var ints = this.getIntersects();
		if(ints.length > 0){
			return ints[0].point;
		}
		return null;
	},

	getIntersects: function(){
		if(this.intersects == null){
			this.intersectScene();
		}
		return this.intersects;
	},

	intersectScene: function(){
		var projector = new THREE.Projector();
		var offsetLeft = this.panel.offset().left;
		var offsetTop = this.panel.offset().top;
		var vector = new THREE.Vector3(( (this.mouseDownX - offsetLeft-1) / (this.width) ) * 2 - 1, - ( (this.mouseDownY - offsetTop+1) / (this.height) ) * 2 + 1, 0.5);
		projector.unprojectVector(vector, this.camera);
		var ray = new THREE.Ray(this.camera.position, vector.subSelf(this.camera.position).normalize());
		var intersects = new Array();
		for(var o = 1;o< this.scene.children.length;o++){//1 is the camera
			var object = this.scene.children[o];
			var objInts = ray.intersectObject(object);
			for(var i = 0;i < objInts.length;i ++){
				intersects.push(objInts[i]);
			}
			var children = object.children;
			for(var c = 0;c< children.length;c++){
				var objIntsC = ray.intersectObject(children[c]);
				for(var i = 0;i < objIntsC.length;i ++){
					intersects.push(objIntsC[i]);
				}
			}
		}
		if(intersects.length > 0){
			var distanceComparator = function(int1,int2){
				return int1.distance-int2.distance;
			}
			intersects.sort( distanceComparator );
		}
		this.intersects = intersects;
		return intersects;
	},

	getImage: function(){
		return this.renderer.domElement.toDataURL();
	}
}
