VG.Axes = function(context,info){

	this.context = context;
	this.info = info;
	var self = this;
	context.preRenderHandlers.push(function(cameraControler){
		self.calculateAxesView(cameraControler);
	});


	if(info != null){
		this.xrange = info.XLim.get(2) - info.XLim.get(1);
		this.yrange = info.YLim.get(2) - info.YLim.get(1);
		this.zrange = info.ZLim.get(2) - info.ZLim.get(1);

		context.cameraControler.setSize(max([this.xrange,this.yrange,this.zrange])*1.5);
		context.cameraControler.setCameraTarget(info.CameraTarget.get(1),info.CameraTarget.get(2),info.CameraTarget.get(3));

		var radius = context.cameraControler.getCameraTarget().subSelf(new THREE.Vector3(info.CameraPosition.get(1),info.CameraPosition.get(2),info.CameraPosition.get(3))).length();
		context.cameraControler.setCameraRadius(radius);
		context.cameraControler.setRotationZ(-info.View.get(1));
		context.cameraControler.setRotationX(info.View.get(2)-90);


		this.box = new THREE.Mesh(new THREE.CubeGeometry(this.xrange, this.yrange, this.zrange), new THREE.MeshBasicMaterial({color: 0x000000, wireframe: true}));
		this.box.visible = info.Box == "on";
		this.box.position.copy(context.cameraControler.getCameraTarget());
		context.addObject(this.box, false);

		var epsilon = (info.Box=="on")? this.xrange/350 : 0;//make it slightly bigger
		this.background = new THREE.Mesh(new THREE.CubeGeometry(this.xrange+epsilon, this.yrange+epsilon, this.zrange+epsilon), new THREE.MeshBasicMaterial({color:(info.Color!=null)? info.Color : 0xffffff}));
		this.background.visible = info.Color != null;
		this.background.position.copy(context.cameraControler.getCameraTarget());
		this.background.flipSided = true;
		context.addObject(this.background, false);


		//Set up Axis Stuff
		var color;
		var ticks;
		var axesDir;
		var tickDir = new THREE.Vector3();
		var pos = new THREE.Vector3();
		var labels;
		var tickLength;

		//store it.
		this.XAxis = new Array();//List<Object3D>
		this.YAxis = new Array();//List<Object3D>
		this.ZAxis = new Array();//List<Object3D>
		this.XAxisText = new Array();//List<ThreeDiv[]>
		this.YAxisText = new Array();//List<ThreeDiv[]>
		this.ZAxisText = new Array();//List<ThreeDiv[]>

		//X Axis
		color = info.XColor;
		ticks = info.XTick;
		labels = info.XTickLabel.split("\n");
		axesDir = new THREE.Vector3(1,0,0);
		tickLength = (this.xrange+this.yrange+this.zrange)/3*info.TickLength.get(2);

		//bottomFront
		pos = pos.clone();pos.set(0, info.YLim.get(1), info.ZLim.get(1));
		tickDir = tickDir.clone();tickDir.set(0, -tickLength, 0);
		this.XAxis.push(this.createAxes(color,ticks,labels,axesDir,tickDir,pos,this.XAxisText));

		//bottomBack
		pos = pos.clone();pos.set(0, info.YLim.get(2), info.ZLim.get(1));
		tickDir = tickDir.clone();tickDir.set(0, tickLength, 0);
		this.XAxis.push(this.createAxes(color,ticks,labels,axesDir,tickDir,pos,this.XAxisText));

		//topFront
		pos = pos.clone();pos.set(0, info.YLim.get(1), info.ZLim.get(2));
		tickDir = tickDir.clone();tickDir.set(0, -tickLength, 0);
		this.XAxis.push(this.createAxes(color,ticks,labels,axesDir,tickDir,pos,this.XAxisText));

		//topBack
		pos = pos.clone();pos.set(0, info.YLim.get(2), info.ZLim.get(2));
		tickDir = tickDir.clone();tickDir.set(0, tickLength, 0);
		this.XAxis.push(this.createAxes(color,ticks,labels,axesDir,tickDir,pos,this.XAxisText));



		//Y Axis
		color = info.YColor;
		ticks = info.YTick;
		labels = info.YTickLabel.split("\n");
		axesDir = new THREE.Vector3(0,1,0);

		//bottomFront
		pos = pos.clone();pos.set(info.XLim.get(1), 0, info.ZLim.get(1));
		tickDir = tickDir.clone();tickDir.set(-tickLength, 0, 0);
		this.YAxis.push(this.createAxes(color,ticks,labels,axesDir,tickDir,pos,this.YAxisText));

		//bottomBack
		pos = pos.clone();pos.set(info.XLim.get(2), 0, info.ZLim.get(1));
		tickDir = tickDir.clone();tickDir.set(tickLength, 0, 0);
		this.YAxis.push(this.createAxes(color,ticks,labels,axesDir,tickDir,pos,this.YAxisText));

		//topFront
		pos = pos.clone();pos.set(info.XLim.get(1), 0, info.ZLim.get(2));
		tickDir = tickDir.clone();tickDir.set(-tickLength, 0, 0);
		this.YAxis.push(this.createAxes(color,ticks,labels,axesDir,tickDir,pos,this.YAxisText));

		//topBack
		pos = pos.clone();pos.set(info.XLim.get(2), 0, info.ZLim.get(2));
		tickDir = tickDir.clone();tickDir.set(tickLength, 0, 0);
		this.YAxis.push(this.createAxes(color,ticks,labels,axesDir,tickDir,pos,this.YAxisText));


		//Z Axis
		color = info.ZColor;
		ticks = info.ZTick;
		labels = info.ZTickLabel.split("\n");
		axesDir = new THREE.Vector3(0,0,1);

		//bottomFront
		pos = pos.clone();pos.set(info.XLim.get(1), info.YLim.get(1), 0);
		tickDir = tickDir.clone();tickDir.set(-1, 0, 0);tickDir.normalize().multiplyScalar(tickLength);
		this.ZAxis.push(this.createAxes(color,ticks,labels,axesDir,tickDir,pos,this.ZAxisText));

		//bottomBack
		pos = pos.clone();pos.set(info.XLim.get(2), info.YLim.get(1), 0);
		tickDir = tickDir.clone();tickDir.set(0, -1, 0);tickDir.normalize().multiplyScalar(tickLength);
		this.ZAxis.push(this.createAxes(color,ticks,labels,axesDir,tickDir,pos,this.ZAxisText));

		//topFront
		pos = pos.clone();pos.set(info.XLim.get(1), info.YLim.get(2), 0);
		tickDir = tickDir.clone();tickDir.set(0, 1, 0);tickDir.normalize().multiplyScalar(tickLength);
		this.ZAxis.push(this.createAxes(color,ticks,labels,axesDir,tickDir,pos,this.ZAxisText));

		//topBack
		pos = pos.clone();pos.set(info.XLim.get(2), info.YLim.get(2), 0);
		tickDir = tickDir.clone();tickDir.set(1, 0, 0);tickDir.normalize().multiplyScalar(tickLength);
		this.ZAxis.push(this.createAxes(color,ticks,labels,axesDir,tickDir,pos,this.ZAxisText));


	}


}


VG.Axes.prototype = {

		constructor: VG.Axes,

		createAxes: function(color,ticks,labels,axesDir,tickDir,pos,textDivHolder){
			if(ticks != null){//They are turned off
				var myTicks = new THREE.Object3D();
				var textDivs = new Array();//List<ThreeDiv>
				for(var i = 1;i<=ticks.numel();i++){

					var geometry = new THREE.Geometry();
					var myVs = geometry.vertices;
					var curTick = axesDir.clone().multiplyScalar(ticks.get(i)).addSelf(pos);
//					curTick.subSelf(THREE.Vector3(info.CameraTarget.get(1),info.CameraTarget.get(2),info.CameraTarget.get(3)));
					myVs.push(curTick);
					myVs.push(curTick.clone().addSelf(tickDir));

					var line = new THREE.Line(geometry, new THREE.LineBasicMaterial({color: color}));

					myTicks.add(line);

					var textDiv = new VG.ThreeDiv(this.context, labels[i-1], curTick.clone().addSelf(tickDir).addSelf(tickDir));
					textDivs.push(textDiv);

				}

				this.context.addObject(myTicks, false);
				textDivHolder.push(textDivs);
				return myTicks;
			}else{
				return null;
			}
		},


		calculateAxesView: function(cameraControler){
			var zrot = Math.acos(Math.cos(cameraControler.getRadiantRotationZ()))*180/Math.PI;
			var xrot = Math.acos(Math.cos(cameraControler.getRadiantRotationX()))*180/Math.PI;
			var is2D = cameraControler.is2D();

			var leftFront,rightFront,rightBack,leftBack;
			var ticks,texts;
			var xfor = zrot<=90 || zrot >=270;//xforward?
			//botFront botBack topFront topBack
			leftFront = xrot<=90?xfor?true:false:false;
			rightFront = xrot<=90?xfor?false:true:false;
			leftBack = xrot>90?xfor?true:false:false;
			rightBack = xrot>90?xfor?false:true:false;
			ticks = [leftFront,rightFront,leftBack,rightBack];
			texts = [leftFront,rightFront,leftBack,rightBack];
			this.switchAxes(this.XAxis,this.XAxisText,ticks,texts);

			var yfor = Math.asin(Math.sin(cameraControler.getRadiantRotationZ()))*180/Math.PI >= 0;//yforward?
			//botFront botBack topFront topBack
			leftFront = xrot<=90?yfor?true:false:false;
			rightFront = xrot<=90?yfor?false:true:false;
			leftBack = xrot>90?yfor?true:false:false;
			rightBack = xrot>90?yfor?false:true:false;
			ticks = [leftFront,rightFront,leftBack,rightBack];
			texts = [leftFront,rightFront,leftBack,rightBack];
			this.switchAxes(this.YAxis,this.YAxisText,ticks,texts);

			leftFront = is2D?false:(!yfor && xfor)?true:false;
			rightFront = is2D?false:(!yfor && !xfor)?true:false;
			rightBack = is2D?false:(yfor && !xfor)?true:false;
			leftBack = is2D?false:(yfor && xfor)?true:false;
			ticks = [leftFront,rightFront,leftBack,rightBack];
			texts = [leftFront,rightFront,leftBack,rightBack];
			this.switchAxes(this.ZAxis,this.ZAxisText,ticks,texts);


			var axesOn = this.info.Visible == "on";
			this.background.visible = (axesOn && this.info.Color != null);
			this.box.visible = (axesOn && (is2D || this.info.Box == "on"));

		},

		switchAxes: function(list,textDivHolder,toThisTick,toThisText){

			var axesOn = this.info.Visible == "on";

			for(var j = 0;j<toThisTick.length;j++){
				var children = list[j].children;
				for(var i = 0;i< children.length;i++){
					children[i].visible = (axesOn && toThisTick[j]);
				}
			}

			for(var j = 0;j<toThisText.length;j++){
				var children = textDivHolder[j];
				for(var i = 0;i< children.length;i++){
					children[i].visible = (axesOn && toThisText[j]);
				}
			}

		}
}
